
 delete from vmscms.VMS_CCFCONF_DTL where VCD_VERSION_NAME not in ('4.2');

UPDATE vmscms.VMS_CCFCONF_DTL SET VCD_DATA_VALUE='INCOM' 
WHERE VCD_DATA_VALUE='INCOMM' ;

UPDATE vmscms.VMS_CCFCONF_DTL 
SET VCD_DATA_LENGTH=1
where VCD_VERSION_NAME='4.2' and VCD_RECORD_TYPE='T' and VCD_DATA_TITLE='T_RECORD_TYPE'; 
  
  
UPDATE vmscms.VMS_CCFCONF_DTL 
SET VCD_DATA_LENGTH=4
where VCD_VERSION_NAME='4.2' and VCD_RECORD_TYPE='D' and VCD_DATA_TITLE='D_RECORD_DELIMITER'; 
  
  
UPDATE vmscms.VMS_CCFCONF_DTL 
SET VCD_DATA_LENGTH=3
where VCD_VERSION_NAME='4.2' and VCD_RECORD_TYPE='H' and VCD_DATA_TITLE='H_CCF_VERSION'; 
  
UPDATE vmscms.VMS_CCFCONF_DTL 
SET VCD_DATA_LENGTH=6
where VCD_VERSION_NAME='4.2' and VCD_RECORD_TYPE='D' and VCD_DATA_TITLE='D_CARD_RECNO'; 

update vmscms.VMS_CCFCONF_DTL set VCD_DATA_VALUE=null,VCD_DATA_FORMAT=null
where VCD_VERSION_NAME='4.2' and VCD_DATA_TITLE in ('D_TRACK_RSET1','D_TRACK_REST2');


update vmscms.vms_ccfconf_dtl  set vcd_value_key='loc'  where vcd_value_key='storeId';
